let listeners: unknown[] = [];

export const nodeStore = {
  addNode() {
    emitChange();
  },

  subscribe(listener: unknown) {
    listeners = [...listeners, listener]
    return () => {
      listeners = listeners.filter(l => l !== listener)
    }
  },

  getSnapshot() {
    return ITEMS;
  }
}


function emitChange() {
  for (let listener of listeners) {
    listener();
  }
}
